                        <div className = "row">
                            <div className = "card col-md-10 offset-md-2 offset-md-2">
                                {/* <h2 className="text-center">Add Donor</h2> */}
                                    <div className="card-body">

                                    </div>
                             </div>
                        </div>
      </div>                              
  }
}
 
export default Home;
